import { Switch, Route } from "react-router-dom";
function App() {
  return (
    <div>
      <Switch>
        <Route path='/' exact>Home</Route>
        <Route path="/popular">Popular Recipes</Route>
        <Route path="/recipes/:id">Recipe Details</Route>
        <Route path="/favourites">Favourites</Route>
      </Switch>
    </div>
  );
}

export default App;
